import { Button, ButtonPositionType } from "primereact";

export const ButtonPrimary = (
  handleClick: any,
  name: string,
  icon: string,
  iconPos: ButtonPositionType
) => {
  return (
    <Button onClick={handleClick} label={name} iconPos={iconPos} icon={icon} />
  );
};
